// lib/blocs/log/bloc/system_log_state.dart
import '../../../base/base_bloc_state.dart';
import '../../../../modules/system_operation_also_main_module/models/system_log_entry.dart';

class SystemLogState extends BaseBlocState {
  final List<SystemLogEntry> entries;
  final bool isStreaming;
  final DateTime? startDate;
  final DateTime? endDate;
  final bool hasMoreEntries;

  SystemLogState({
    required super.isLoading,
    super.error,
    super.lastUpdated,
    required this.entries,
    required this.isStreaming,
    this.startDate,
    this.endDate,
    this.hasMoreEntries = false,
  });

  factory SystemLogState.initial() {
    return SystemLogState(
      isLoading: false,
      entries: const [],
      isStreaming: false,
    );
  }

  SystemLogState copyWith({
    bool? isLoading,
    String? error,
    DateTime? lastUpdated,
    List<SystemLogEntry>? entries,
    bool? isStreaming,
    DateTime? startDate,
    DateTime? endDate,
    bool? hasMoreEntries,
  }) {
    return SystemLogState(
      isLoading: isLoading ?? this.isLoading,
      error: error ?? this.error,
      lastUpdated: lastUpdated ?? this.lastUpdated,
      entries: entries ?? this.entries,
      isStreaming: isStreaming ?? this.isStreaming,
      startDate: startDate ?? this.startDate,
      endDate: endDate ?? this.endDate,
      hasMoreEntries: hasMoreEntries ?? this.hasMoreEntries,
    );
  }
}
